import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

import { initializeApp } from "firebase/app";

const firebaseConfig = {
  apiKey: "AIzaSyBr3oicVK6A2HCae8JeOgCQUBlfXlNJErQ",
  authDomain: "heladeria-ecommerce.firebaseapp.com",
  projectId: "heladeria-ecommerce",
  storageBucket: "heladeria-ecommerce.appspot.com",
  messagingSenderId: "981501370218",
  appId: "1:981501370218:web:fb207fb7d836dce3118f13"
};

// Initialize Firebase
initializeApp(firebaseConfig);

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
